You can see a full example of Rust custom resolvers here . To write resolvers within your graphql canister, start by augmenting your schema, for example in canisters/graphql/src/schema.graphql: type Query { custom_get(id: ID!): Message
} type Mutation { custom_set(id: ID!, text: String): Boolean!
} type Message { id: ID! text: String!
} We've added one custom query and one custom mutation to the schema. Next we need to implement the resolvers in code. To implement a resolver, we add an asynchronous function to the Rust file that contains our graphql_database macro invocation. The function should have the same name as the query or mutation in the schema, and should use parameter and return types that match the types in the schema. The return type should be a Result with the Ok variant matching the return type in the schema, and you should use sudograph::async_graphql::Error as the Err variant. Object types generated from your schema are automatically in scope in Rust, because they are generated by the graphql_database macro. Type conversions between GraphQL and Rust can be found here . Now we'll implement the custom resolvers for the query and mutation in canisters/graphql/src/graphql.rs: use sudograph::graphql_database; graphql_database!("canisters/graphql/src/schema.graphql"); type PrimaryKey = String;
type MessageStore = HashMap<PrimaryKey, Option<Message>>; async fn custom_get(id: ID) -> Result<Option<Message>, sudograph::async_graphql::Error> { let message_store = sudograph::ic_cdk::storage::get::<MessageStore>(); let message_option = message_store.get(&id.to_string()); match message_option { Some(message) => { return Ok(message.clone()); }, None => { return Ok(None); } };
} async fn custom_set(id: ID, text: Option<String>) -> Result<bool, sudograph::async_graphql::Error> { let message_store = sudograph::ic_cdk::storage::get_mut::<MessageStore>(); let message = match text { Some(text_value) => Some(Message { id: id.clone(), text: text_value }), None => None }; message_store.insert(id.to_string(), message); return Ok(true);
}

