} type Mutation { custom_set(id: ID!, text: String): Boolean! @canister(id: "ryjl3-tyaaa-aaaaa-aaaba-cai")
} type Message { id: ID! text: String!
} Notice we've added @canister(id: "ryjl3-tyaaa-aaaaa-aaaba-cai") to the custom query and mutation. Now we need to implement the Rust canister. Let's imagine we've created another Rust canister in canisters/another-rust-canister. We might have a file called canisters/another-rust-canister/src/lib.rs, and it would look like this: use sudograph; // TODO This hasn't been tested, might need some derive macros
struct ID(String); impl ID { fn to_string(&self) -> String { return String::from(&self.0); }
} // TODO This hasn't been tested, might need some derive macros
struct Message { id: String, text: String
}; type PrimaryKey = String;
type MessageStore = HashMap<PrimaryKey, Option<Message>>; #[sudograph::ic_cdk_macros::query]
async fn custom_get(id: ID) -> Option<Message> { let message_store = sudograph::ic_cdk::storage::get::<MessageStore>(); let message_option = message_store.get(&id.to_string()); match message_option { Some(message) => { return message.clone(); }, None => { return None; } };
} #[sudograph::ic_cdk_macros::update]
async fn custom_set(id: ID, text: Option<String>) -> bool { let message_store = sudograph::ic_cdk::storage::get_mut::<MessageStore>(); let message = match text { Some(text_value) => Some(Message { id: id.clone(), text: text_value }), None => None }; message_store.insert(id.to_string(), message); return true;
} Notice that these functions do not return a Result, they directly return the Rust types that correspond to the GraphQL types . This may change in the future as returning a Result may end up being more appropriate. Also notice that we had to implement the ID and Message types ourselves. We do not have all of the generated types available because we are not using the graphql_database macro in this canister. In the future Sudograph may provide a simple way to generate these types for you without generating the entire database, but for now you'll have to implement them yourself or figure out an appropriate way to induce proper serialization and deserialization. For example, Candid might serialize and deserialize ID to and from strings for us...you'll just have to figure this out on your own for now.

