} type Message { id: ID! text: String!
} Notice we've added @canister(id: "ryjl3-tyaaa-aaaaa-aaaba-cai") to the custom query and mutation. Now we need to implement the Motoko canister. Let's imagine we've created a Motoko canister in canisters/motoko. We might have a file called canisters/motoko/main.mo, and it would look like this: import Text "mo:base/Text";
import Map "mo:base/HashMap";
import Option "mo:base/Option"; actor Motoko { let message_store = Map.HashMap<Text, ?Message>(10, Text.equal, Text.hash); type Message = { id: Text; text: Text; }; public query func customGet(id: Text): async ?Message { return Option.flatten(message_store.get(id)); }; public func customSet(id: Text, text: ?Text): async Bool { let message: ?Message = switch (text) { case null null; case (?text_value) Option.make({ id; text = text_value; }); }; message_store.put(id, message); return true; };
} Implementing the Motoko resolvers is very similar to implementing the Rust resolvers, the biggest difference besides the lanuage itself being the type conversions . We've implemented the Message type, and we've excluded the ID type and just used the native Motoko Text type. Again, you might have to experiment with the serialization and deserialization of values between canisters, a lot of it has to do with Candid.

